import React from 'react';
import "./Reating.css"

export function Rating({rating}){

    const star=array.from({length: 5},(_,index)=>{
        <span key={index} className={index < rating ? 'star-filled' : 'star-empty'}>&#9733;</span>
        
    })
return <div className='rating'>{star}</div>
}
